import React from 'react';
import AppLayout from '../components/AppLayout';
import LolUpdateForm from '../components/LolUpdateForm';

const Lol_Update = () => {
    return (
        <AppLayout>
            <LolUpdateForm/>
        </AppLayout>
    );
};

export default Lol_Update;
